const initState = {
    projects :[
        {id:1,title:'greger',content:'fergreh'},
        {id:2,title:'greger',content:'fergreh'},
        {id:3,title:'greger',content:'fergreh'},
    ]
};

const projectReducer = (state = initState, action) => {
    return state;
};

export default projectReducer;
